import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './styles.css';

// Import all the components
import About from './About';
import AdminDashboard from './AdminDashboard';
import AppointmentAdmin from './AppointmentAdmin';
import AppointmentInstructor from './AppointmentInstructor';
import Appointments from './Appointments';
import ContactUs from './ContactUs';
import Files from './Files';
import FilesInstructor from './FilesInstructor';
import ForgotPassword from './ForgotPassword';
import Grades from './Grades';
import Home from './index';
import InstructorAdmin from './InstructorAdmin';
import InstructorDashboard from './InstructorDashboard';
import InstructorPro from './InstructorPro';
import InstructorQA from './InstructorQA';
import Login from './Login';
import Messages from './Messages';
import MessagesInstructor from './MessagesInstructor';
import MessagesPro from './MessagesPro';
import MessagesQA from './MessagesQA';
import ProgcordQA from './ProgcordQA';
import ProgramCoordinatorDashboard from './ProgramCoordinatorDashboard';
import QADashboard from './QADashboard';
import QAOfficerAdmin from './QAOfficerAdmin';
import Services from './Services';
import SignUp from './SignUp';
import StudentAdmin from './StudentAdmin';
import StudentDashboard from './StudentDashboard';
import StudentInstructor from './StudentInstructor';
import StudentPro from './StudentPro';
import StudentQA from './StudentQA';

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/about" component={About} />
          <Route exact path="/admin-dashboard" component={AdminDashboard} />
          <Route exact path="/appointment-admin" component={AppointmentAdmin} />
          <Route exact path="/appointment-instructor" component={AppointmentInstructor} />
          <Route exact path="/appointments" component={Appointments} />
          <Route exact path="/contact-us" component={ContactUs} />
          <Route exact path="/files" component={Files} />
          <Route exact path="/files-instructor" component={FilesInstructor} />
          <Route exact path="/forgot-password" component={ForgotPassword} />
          <Route exact path="/grades" component={Grades} />
          <Route exact path="/index" component={index} />
          <Route exact path="/instructor-admin" component={InstructorAdmin} />
          <Route exact path="/instructor-dashboard" component={InstructorDashboard} />
          <Route exact path="/instructor-pro" component={InstructorPro} />
          <Route exact path="/instructor-qa" component={InstructorQA} />
          <Route exact path="/login" component={Login} />
          <Route exact path="/messages" component={Messages} />
          <Route exact path="/messages-instructor" component={MessagesInstructor} />
          <Route exact path="/messages-pro" component={MessagesPro} />
          <Route exact path="/messages-qa" component={MessagesQA} />
          <Route exact path="/progcord-qa" component={ProgcordQA} />
          <Route exact path="/program-coordinator-dashboard" component={ProgramCoordinatorDashboard} />
          <Route exact path="/qa-dashboard" component={QADashboard} />
          <Route exact path="/qa-officer-admin" component={QAOfficerAdmin} />
          <Route exact path="/services" component={Services} />
          <Route exact path="/sign-up" component={SignUp} />
          <Route exact path="/student-admin" component={StudentAdmin} />
          <Route exact path="/student-dashboard" component={StudentDashboard} />
          <Route exact path="/student-instructor" component={StudentInstructor} />
          <Route exact path="/student-pro" component={StudentPro} />
          <Route exact path="/student-qa" component={StudentQA} />
          {/* Add more routes for other pages as needed */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
